import { Link } from 'react-router-dom';

export default function Dashboard() {
  return (
    <div className="min-h-screen bg-pink-50 p-6 space-y-6">
      <h1
        className="text-4xl text-center text-pink-600 font-bold"
        style={{ fontFamily: "'Handlee', cursive" }}
      >
        ðŸŒ¸ Your Mood Dashboard
      </h1>

      {/* Charts Section */}
      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Weekly Mood Chart */}
        <div className="bg-white rounded-xl shadow-md p-4">
          <h2 className="text-lg font-semibold text-pink-500 mb-2">Mood This Week</h2>
          <div className="h-64 flex items-center justify-center bg-pink-100 rounded">
            {/* Replace this with your chart component */}
            ðŸ“ˆ Weekly Chart Here
          </div>
        </div>

        {/* Monthly Mood Chart */}
        <div className="bg-white rounded-xl shadow-md p-4">
          <h2 className="text-lg font-semibold text-pink-500 mb-2">Mood This Month</h2>
          <div className="h-64 flex items-center justify-center bg-pink-100 rounded">
            {/* Replace this with your chart component */}
            ðŸ“Š Monthly Chart Here
          </div>
        </div>
      </div>

      {/* Calendar + Streak Section */}
      <div className="bg-white rounded-xl shadow-md p-4">
        <h2 className="text-lg font-semibold text-pink-500 mb-4">ðŸŒˆ Your Streak</h2>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          {/* Calendar */}
          <div className="md:col-span-2">
            <div className="bg-pink-100 p-4 rounded h-64 flex flex-wrap justify-center items-center">
              {/* Example of days marked */}
              <div className="grid grid-cols-7 gap-1 w-full text-center">
                {[...Array(30)].map((_, i) => (
                  <div
                    key={i}
                    className="w-8 h-8 flex items-center justify-center text-sm"
                  >
                    {i + 1} {i % 3 === 0 ? 'ðŸ’–' : ''}
                  </div>
                ))}
              </div>
            </div>
          </div>

          {/* Stats */}
          <div className="flex flex-col justify-center bg-pink-100 p-4 rounded text-center space-y-2">
            <p className="text-pink-600 font-bold text-lg">ðŸ”¥ Streak: 7 days</p>
            <p className="text-pink-600">âœ¨ Active Days: 12</p>
          </div>
        </div>
      </div>

      {/* Button to Diary */}
      <div className="text-center">
        <Link
          to="/diary"
          className="bg-pink-500 text-white text-xl px-6 py-3 rounded-full shadow hover:bg-pink-600 transition"
          style={{ fontFamily: "'Handlee', cursive" }}
        >
          ðŸŒ¸ How are you feeling today?
        </Link>
      </div>
    </div>
  );
}
